export const circleData = [
  {
    percentage: 5,
    color: "#8BC34A",
    max: 14,
    radius: 120,
    texto: "Casos Atendidos",
  },
  {
    percentage: 14,
    color: "skyblue",
    max: 100,
    radius: 75,
    texto: "Casos Reportados",
  },
  {
    percentage: 9,
    color: "#F6230A",
    max: 14,
    radius: 75,
    texto: "Casos sin atender",
  },
];
